def cmd(CMD):
    subprocess.call(CMD.split(' '))

def subkeys(key):
    i = 0
    while True:
        try:
            subkey = _winreg.EnumKey(key, i)
            yield subkey
            i+=1
        except WindowsError as e:
            break
        
def traverse_registry_tree(hkey, keypath, tabs=0):
    key = _winreg.OpenKey(hkey, keypath, 0, _winreg.KEY_READ)
    for subkeyname in subkeys(key):
        subkeypath = "%s\\%s" % (keypath, subkeyname)
        registry_key = _winreg.OpenKey(_winreg.HKEY_LOCAL_MACHINE, subkeypath, 0, _winreg.KEY_READ)
        try:
            value, regtype = _winreg.QueryValueEx(registry_key, 'DisplayName')
            #print value, regtype
            if value.find('Microsoft Visual C++ 2015 Redistributable (x86)') > -1:
                #print value
                return value
        except:
            pass
        traverse_registry_tree(hkey, subkeypath, tabs+1)
    return False

